CREATE TABLE `main_employees_history` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `date_of_joining` date DEFAULT NULL,
  `date_of_leaving` date DEFAULT NULL,
  `reporting_manager` int(10) unsigned DEFAULT NULL,
  `reporting_manager_name` varchar(250) DEFAULT NULL,
  `emp_status_id` int(10) unsigned DEFAULT NULL,
  `emp_status_name` varchar(250) DEFAULT NULL,
  `LocationID` int(11) NOT NULL DEFAULT '1',
  `businessunit_id` int(10) unsigned DEFAULT NULL,
  `businessunit_name` varchar(250) DEFAULT NULL,
  `department_id` int(10) unsigned DEFAULT NULL,
  `department_name` varchar(250) DEFAULT NULL,
  `jobtitle_id` int(10) unsigned DEFAULT NULL,
  `jobtitle_name` varchar(250) DEFAULT NULL,
  `position_id` int(10) unsigned DEFAULT NULL,
  `position_name` varchar(250) DEFAULT NULL,
  `years_exp` varchar(10) DEFAULT NULL,
  `holiday_group` int(10) unsigned DEFAULT NULL,
  `holiday_group_name` varchar(250) DEFAULT NULL,
  `prefix_id` int(10) unsigned DEFAULT NULL,
  `prefix_name` varchar(250) DEFAULT NULL,
  `extension_number` varchar(20) DEFAULT NULL,
  `office_number` varchar(20) DEFAULT NULL,
  `office_faxnumber` varchar(20) DEFAULT NULL,
  `is_orghead` tinyint(2) DEFAULT NULL,
  `staged_AadharNumber` varchar(100) DEFAULT NULL,
  `staged_PanNo` varchar(100) DEFAULT NULL,
  `AadharNumber` varchar(100) DEFAULT NULL,
  `PanNo` varchar(100) DEFAULT NULL,
  `aadhar_pan_status` enum('Submitted','Approved','Rejected') DEFAULT NULL,
  `aadhar_pan_rejection_status` varchar(120) DEFAULT NULL,
  `Passport` varchar(20) NOT NULL,
  `BandLevel` varchar(5) DEFAULT NULL,
  `IDProof` varchar(50) DEFAULT NULL,
  `IDNumber` varchar(50) DEFAULT NULL,
  `ApprovalStatus` int(11) NOT NULL DEFAULT '0',
  `IsFirstLogin` int(11) NOT NULL DEFAULT '0' COMMENT '0 - First Login, 1 - Already Logged In',
  `ISProjectManager` varchar(3) NOT NULL DEFAULT 'No',
  `emprole` int(10) unsigned DEFAULT NULL,
  `emprole_name` varchar(250) DEFAULT NULL,
  `firstname` varchar(255) DEFAULT NULL,
  `lastname` varchar(255) DEFAULT NULL,
  `userfullname` varchar(250) DEFAULT NULL,
  `emailaddress` varchar(100) DEFAULT NULL,
  `contactnumber` varchar(20) DEFAULT NULL,
  `backgroundchk_status` enum('In process','Completed','Not Applicable','Yet to start','On hold') DEFAULT NULL,
  `employeeId` varchar(20) DEFAULT NULL,
  `modeofentry` varchar(100) DEFAULT NULL,
  `other_modeofentry` varchar(100) DEFAULT NULL,
  `selecteddate` date DEFAULT NULL,
  `candidatereferredby` int(10) unsigned DEFAULT NULL,
  `referer_name` varchar(250) DEFAULT NULL,
  `profileimg` varchar(250) DEFAULT NULL,
  `createdby` int(10) unsigned DEFAULT NULL,
  `createdby_name` varchar(250) DEFAULT NULL,
  `modifiedby` int(10) unsigned DEFAULT NULL,
  `createddate` datetime DEFAULT NULL,
  `modifieddate` datetime DEFAULT NULL,
